        public Dictionary<int, List<DefCode>> MobileAll()
        {
            return _mobile;
        }

        public Dictionary<int, DefCode> StationaryAll()
        {
            return _stationary;
        }

        public DefCode Find(string prefix, string number)
        {
            var _prefix = int.Parse(prefix);
            var _number = int.Parse(number);
            return Find(_prefix, _number);
        }

        public DefCode Find(PhoneInfo phoneInfo)
        {
            var prefix = int.Parse(phoneInfo.Phone.Prefix);
            var number = int.Parse(phoneInfo.Phone.Number);
            return Find(prefix, number);
        }

        public DefCode Find(string phone)
        {
            if (phone.Length > 12 || phone.Length < 10)
            {
                throw new ArgumentNullException("Префикс (DEF-code) не найден", 
                      new FormatException("Неправильный формат строки телефона")
                    );
            }

            int start = 0;
            if (phone.StartsWith("+7") && phone.Length == 12) { start = 2; }
            if (phone.StartsWith("8") && phone.Length == 11) { start = 1; }

            var prefix = int.Parse(phone.Substring(start, 3));
            var number = int.Parse(phone.Substring(start + 3, 7));
            return Find(prefix, number);
        }

        public DefCode Find(int prefix, int number)
        {
            try
            {
                return prefix.ToString().First() == '9' ? 
                    _mobile.First(x => x.Key == prefix).Value
                           .First(x => x.Min <= number && x.Max >= number) :
                    _stationary.First(x => x.Key == prefix).Value;
            }
            catch (Exception e)
            {
                throw new ArgumentNullException($"Префикс или номер не существует", e);
            }
        }


